import React from 'react';
import { ProductData } from "../Helpers/ProductData.js";
import trenchCoat1 from "../Images/trenchCoat1.jpg";
import trenchCoat2 from "../Images/trenchCoat2.jpg";
import trenchCoat3 from "../Images/trenchCoat3.jpg";
import trenchCoat4 from "../Images/trenchCoat4.jpg";
import "../css/CardList.css";
import Card from './Card';

const CardList = () => {
    return (
        <div className = "new-product">
                 <div className="row">
                <Card image = {trenchCoat1} nameProduct = "Áo khoác nữ form Fitted" price = "500.000 VNĐ"></Card>
                <Card image = {trenchCoat2} nameProduct = "Áo khoác nữ form Fitted" price = "800.000 VNĐ"></Card>
                <Card image = {trenchCoat3} nameProduct = "Áo khoác nữ form Fitted" price = "600.000 VNĐ"></Card>
                <Card image = {trenchCoat4} nameProduct = "Áo khoác nữ form Fitted" price = "500.000 VNĐ"></Card>
                
                {ProductData.map((item, index) => {
                    <Card image = {item.img} nameProduct = {item.nameProduct} price = {item.price}></Card>
                })}
              </div>
        </div>
    );
}

export default CardList;
